INSERT INTO `news` (`id`, `date`, `title`, `thumb_name`, `category`, `content`, `is_activated`, `is_blog`, `member_id`, `viewcnt`, `result`, `tag`) VALUES
  (1, '2015-01-03 18:45:27', '지속적인 관계를 지향하겠습니다.', 'dcab7f641ce3e69590d690b6c7ec8615.png', 1, '<p>고객만족은 마케팅활동의 주요한 결과로서 구매 후 태도변화, 반복구매, 상표충성도등의 구매 후 행동에 영향을 미친다.</p>\r\n\r\n<p>소비자행동과 관련된 여러 연구들에서 고객만족을&nbsp;경험하였던 고객들은 더욱 높은 재구매의도를 보인다는 결과를 찾아 볼 수 있다(Oliver1980; Churchill and Surprenaut 1982; Fornell 1992).</p>\r\n\r\n<p>Anderson(1998)의 연구에서는 소비자의 만족경험이 미래의 재구매의도에 영향을 미치는데 만족한 소비자일수록 재구매의도가 높다는 결과를 보여주고 있다.</p>\r\n\r\n<p>Fornell(1992)은 고객만족이 증가함에 따라 고객충성도가 증가하고, 가격민감도가 감소하고, 고객이탈이 줄어든다고 주장하고 있다.</p>\r\n\r\n<p>Szymanskiand Henard(2001)는 메타분석을 통해 고객만족과 반복구매간의 관계를 분석하였는데 고객만족이 높을수록 반복구매가 증가한다는 것을 보여주고 있다.&nbsp;</p>\r\n\r\n<p>서비스분야의 연구들에서도 서비스에 대한 고객만족이 증가하면 재구매행동이나 재이용행동이 증가한다는 연구결과를 많이 찾아 볼 수 있다.</p>\r\n\r\n<p>(Reichheld and Sasser 1990;Parasuraman et al. 1991; Oliva et al. 1992). Bendapudi and Berry(1997)는 서비스에 대해 만족을 경험한 고객은 대안적인 서비스제공자들이 만족스럽지 않을지도 모른다는 불확실성을 크게 지각하기 때문에 만족스러운 서비스제공자와의 관계를 종결하려 할 때 높은교체비용을 지각하게 된다고 주장하고 있다.</p>\r\n\r\n<p>Patterson et al.(1997)은 산업서비스와 관련하여 서비스제공기업에 대한 만족도가 높을수록 서비스제공기업에 대한 재구매의도가&nbsp;높아진다는 것을 실증적으로 보여주고 있다.</p>\r\n\r\n<p>이러한 여러 연구들에 근거해 볼 때 중개서비스에 대해 만족한 고객은 향후에도 만족스러운 중개서비스를 제공한 중개사로부터&nbsp;중개서비스를 받으려는 의도가 높을 것이라고 예상할 수 있다.</p>\r\n', 1, 0, 2, 1, '0', '직장인,신혼부부'),
  (2, '2015-02-22 08:21:49', '친절하게 설명드리겠습니다.', 'f2fc43f7176e08a89da528890f94f84d.png', 1, '<p>판매활동에 있어서 판매프레젠테이션을 판매활동의 핵심적 요소로서 효과적인 판매프레젠테이션은 판매활동의 성패를 결정하는 경우가 많다(Behrman and Perreault, 1982;Strutton and Lumpkin 1994).</p>\r\n\r\n<p>부동산중개서비스에 있어서도 중개사가 아무리 우수한 능력을 가지고, 청취행동을 통해 고객의 니즈, 부동산에 대한 선호 등을 효과적으로 파악하고, 적합한 부동산을 선정하여 중개하려고 해도 해당부동산을 고객에게 효과적으로 제시하지 못한다면 성공적인 중개서비스를 제공하기는 어려울 것이다.</p>\r\n\r\n<p>이런 이유에서 부동산중개서비스과정에 있어서 고객을 설득할 수 있고, 계약체결을 유도할 수 있는 효과적인 판매프레젠테이션은 필수적이라 할 수 있다.</p>\r\n\r\n<p>중개사는 고객이 가진 문제나 중요한&nbsp;요구사항을 충분히 이해하면서 중개서비스를 제공하고 있다는 확신이 들도록 하고, 고객이 제시한 질문과 이의에 대해 적절한 해결책을 제시하고, 주장하고자 하는 바나 제안을 명료하고 간결하게 전달함으로써 자신들의 판매프레젠테이션의 효과성을 극대화할&nbsp;수 있다.</p>\r\n\r\n<p>판매프레젠테이션의 효과성과 관련하여 Behrman and Perreault(1982)의 연구에서는 판매원의 판매프레젠테이션의 효과성을 중요한 성과지표중의 하나로 다루고 있는데&nbsp;Jaramillo and Marshall(2004)의 연구에서는 성과가 우수한 판매원은 성과가 낮은 판매원에 비해 더욱 효과적인 판매프레젠테이션을 한다는 것을 보여주고 있다.</p>\r\n\r\n<p>이러한 연구결과는 판매프레젠테이션의 효과성이 판매활동의 성공을 결정하는 중요한 요인이라는 것을 보여준다.</p>\r\n\r\n<p>한편, 효과적 프레젠테이션은 판매원에 대한 고객의 신뢰와 만족을 유발하는데 있어서 필수적인 요소이다.</p>\r\n\r\n<p>판매원이 고객에게 효과적인 판매프레젠테이션을 수행했을 때 고객들은 판매원의 설명을 충분히 이해하게 되고, 판매원의 주장을 믿게 된다는 점에서 효과적 판매프레젠테이션은 판매원에 대한 신뢰에 영향을 준다.</p>\r\n\r\n<p>또한 효과적인 판매프레젠테이션에 따라 판매원이 추천하는 상품을 명확하게 이해하고 확신을 가지고 구매하게 됨으로써 판매활동에 대해 만족할 가능성이 높아진다.</p>\r\n\r\n<p>중개서비스에 있어서도 중개사의 판매프레젠테이션이 효과적인 경우에 고객들은 해당부동산의 장단점을&nbsp;명확하게 이해하고서 올바른 의사결정을 할 가능성이 높고, 부동산중개서비스를 통해&nbsp;해결하고자 했던 문제를 효과적으로 해결할 수 있다&nbsp;확신을 가지고 거래할 가능성이&nbsp;높기 때문에 해당 중개서비스에 대해 만족할 가능성이 높다.</p>\r\n\r\n<p>이러한 점에서 중개사의&nbsp;판매프레젠테이션이 효과적이라고 지각하는 고객일수록 중개서비스가 만족스럽다고 평가할 가능성이 높다.</p>\r\n', 1, 0, 2, 5, '0', '상품권'),
  (3, '2015-02-22 08:22:54', '자신의 장점을 나타내자!', '58a15c583f09e5ee270fc9d4385afff4.png', 1, '<p>부동산 중개서비스는 중개의뢰인과의 상호작용을 필요로 한다는 점에서 대인적 성격을 가지면서</p>\r\n\r\n<p>중개대상이 되는 부동산에 대한 정보수집과 분석 등을 필요로 한다는 점에서 대물적 성격을 가진다.</p>\r\n\r\n<p>중개서비스를 성공적으로 제공하기 위해서 중개사는 정보수집 및 분석능력, 고객과의 효과적 대인관계능력, 고객서비스능력 등의 기본적 능력을 보유하고 있어야 한다.</p>\r\n\r\n<p>판매원 연구에서도 성공적인 판매활동을 하기 위해서 판매원은 판매활동을 수행하기 위한 몇 가지의 기본적 능력을 가져야 한다고 보고 있다.</p>\r\n\r\n<p>이들 연구에서는 판매원이 판매활동을 수행하기 위한 가져야 할 판매원의 능력을 판매스킬(selling&nbsp;skill)이라 부른다.</p>\r\n\r\n<p>판매스킬은 판매활동을 수행하는데 필요한 여러 업무들을 수행할 수&nbsp;있는 능력으로 판매원마다 차이가 있기 때문에 판매활동의 성과도 달라진다고 보고 있다(Rentz et al., 2002).</p>\r\n\r\n<p>대인적 서비스로서의 성격을 가진 중개서비스를 효과적으로 제공하기 위해서 중개사는 고객과의 상호작용에 기본이 되는 대인관계능력과 고객서비스능력을 보유해야 한다.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n', 1, 0, 2, 3, '0', '5만원'),
  (4, '2015-02-22 08:23:59', '고객별 맞춤서비스 제공', '004a0aa7f44cddb821b8f2ec19561743.png', 1, '<p>부동산중개서비스는 기본적으로 개별고객의 특성에 맞추어 개별고객에게 적합하도록제공되는 적응적 성격의 서비스이다.</p>\r\n\r\n<p>그러므로 만족스러운 중개서비스를 제공하기 위해서는 중개사는 개별고객의 니즈와 특징을 파악하고 이에 적합하도록 그들의 중개서비스를 조정할 필요가 있다.</p>\r\n\r\n<p>즉, 중개사는 고객과의 상호작용을 통해 파악한 정보를 최대한&nbsp;활용하여 개별고객에게 가장 효과적이라고 생각되는 중개서비스방법을 선택하고, 이를&nbsp;효과적으로 수행할 필요가 있다.</p>\r\n\r\n<p>이와 같이 판매원이 개별고객의 특성을 파악하고, 개별고객에 가장 적합한 판매활동을 찾아서 판매활동을 수행하는 것을 판매원 연구에서는&nbsp;적응적 판매행동(adaptive selling)이라 부른다.</p>\r\n\r\n<p>적응적 판매행동은 고객과의 상호작용을&nbsp;하는 동안에 판매상황과 고객에 대해 파악된 정보를 바탕으로 고객에 적합하도록 판매행위를 변경하는 판매활동이라 정의된다(Weitz et al., 1986, p. 175).</p>\r\n\r\n<p>적응적 판매행동과&nbsp;관련하여 Sujan(1986)의 연구에서는 판매원은 고객의 특성을 무시하고 열심히 일하기보다는 고객의 특성에 맞추어 적절한 판매활동을 수행하는 형태로 스마트하게 일해야 한다고 주장하고 있다.</p>\r\n\r\n<p>이런 주장을 중개서비스에 적용해보면 고객의 특성을 고려하지 않고 일방적이고 천편일률적인 중개서비스를 제공하기 보다는 고객의 특성을 파악하고,&nbsp;고객에게 가장 적합한 중개서비스방법을 찾아내어서 개별고객에게 고객화된 중개서비스<br />\r\n를 제공해야 한다는 것을 의미한다.&nbsp;</p>\r\n\r\n<p>기존 연구들은 판매원들이 적응적 판매행동을 수행함으로써 더욱 높은 판매성과를 얻을 수 있다는 것을 보여주고 있다.</p>\r\n\r\n<p>Predmore and Bonnice(1994)의 연구에서는 기업의 텔레마케터들을 대상으로 연구하였는데 적응적 판매행동을 수행하는 텔레마케터일수록 판매성공가능성이 높다는 것을 실증적으로 보여주고 있다.</p>\r\n\r\n<p>Spiro and Weitz(1990)의 연구,&nbsp;Boorom et al.(1998)의 연구 등에서도 적응적 판매행동을 수행하는 판매원의 성과가 더욱&nbsp;높다는 것을 보여주고 있다.</p>\r\n\r\n<p>적응적 판매행동은 판매성과뿐만 아니라 고객만족에도 영향을 준다는 연구도 있는데 Kennedy et al.(2001)은 자동차 판매원이 적응적 판매행동을&nbsp;수행하는 경우 고객들은 판매원을 더욱 신뢰하였고, 더욱 만족한다는 연구결과를 보여<br />\r\n주고 있다. 이러한 여러 연구결과들은 부동산 중개서비스에 있어서도 중개사가 개별고객의 특성을 파악하고, 개별고객에 특성에 맞추어 적합한 중개서비스방법을 선정하고,고객별로 고객화된 중개서비스를 제공함으로써 고객만족을 높일 수 있다는 추론을 가능하게 한다.&nbsp;</p>\r\n', 1, 0, 2, 0, '0', '무료'),
  (5, '2015-02-22 08:25:07', '고객의 목소리를 듣겠습니다.', '1f78487046b5f4b3b6df57f0162bcb61.png', 1, '<p>중개사들이 만족스러운 중개서비스를 제공하기 위해 고객의 상황, 부동산에 대한 니즈와 선호, 재무적 능력 등을 잘 파악하고 있어야 한다.</p>\r\n\r\n<p>이러한 점에서 만족스러운 중개서비스를 제공하기 위해서 중개사는 고객과의 상호작용과정 속에서 고객의 선호, 의견,태도 등을 효과적으로 청취할 수 있어야 한다.</p>\r\n\r\n<p>이러한 중개사의 청취행동은 중개서비스를 제공하기 위해 필요한 정보를 획득하려는 능동적이고 전향적 과정으로 고객과의 상호작용을 통해 고객의 언어적ㆍ비언어적 메시지를 능동적으로 감지하고, 중요한 정보를처리하고, 해석하고, 평가하고, 반응하는 인지적 과정이다(Castleberry and Shepherd, 1993, p.36).</p>\r\n\r\n<p>고객과 상호작용하는 과정에 고객의 목소리에 귀를 기울이려는 행동을 청취행동이라&nbsp;부르지만 이러한 청취행동에는 다양한 수준이 존재할 수 있다.</p>\r\n\r\n<p>Comer and Drollinger(2000)의 연구에서는 3가지 수준의 청취행동을 제시하고 있다.</p>\r\n\r\n<p>이들이 제시하는 가장 낮은 수준의 청취행동은 고객이 하는 말을 듣기는 하지만 쉽게 산만해지고, 다른 곳에 신경을 쓰기 때문에 중요하거나 핵심적인 내용을 놓치고, 미묘한 언어적 느낌이나 비언어적 단서를 감지하지 못해서 고객이 전달하는 메시지를 부정확하게 해석하는 Marginallistening이다.</p>\r\n\r\n<p>이 보다 높은 수준의 청취행동을 Active listening인데 고객과의 상호작용을&nbsp;통해 고객이 보내는 언어적ㆍ비언어적 메시지를 수신하고, 처리하고, 반응하는 청취행동이다.</p>\r\n\r\n<p>가장 높은 수준의 청취행동은 Active empathetic Listening인데 이것은 고객이 보내는 언어적ㆍ비언어적 메시지를 이해하고 처리하고, 언어적ㆍ비언어적으로 반응하고, 고객의 입장에서 고객이 보내는 메시지의 숨겨진 의미를 찾으려하는 청취행동이다.</p>\r\n\r\n<p>이와&nbsp;같이 청취행동은 다양한 수준이 존재할 수 있는데 중개서비스의 경우에도 중개사가 어떤 유형의 청취행동을 수행하는가에 따라 서비스품질과 고객만족이 달라질 수 있다.</p>\r\n\r\n<p>중개서비스에 있어 중개사의 청취행동은 만족스러운 중개서비스를 제공하기 위한 기본적인 활동이다.</p>\r\n\r\n<p>판매원 연구에서는 판매원의 청취행동을 성공적인 판매활동을 하기&nbsp;위해서 필수적인 행동으로 보고 있다.</p>\r\n\r\n<p>Comer and Drollinger(2000)의 연구에서는 우수한&nbsp;청취행동을 수행하는 판매원은 판매상황을 더욱 정확하게 평가하고, 개별고객의 특성을&nbsp;더욱 정확하고 신속하게 파악함으로써 고객과 더욱 호의적 관계를 구축할 수 있고, 고객의 니즈에 더욱 적합한 제품을 제시할 수 있고, 고객의 요구에 맞는 판매활동을 수행함으로써 성공적인 판매활동을 수행할 수 있다고 주장하고 있다.</p>\r\n\r\n<p>한편, Ramsey and&nbsp;Sohi(1997)의 연구에서는 판매원의 청취행동에 대한 고객의 지각에 대해 연구하였는데&nbsp;판매원이 청취행동을 잘 수행했다고 지각하는 고객일수록 판매원을 더욱 신뢰하였고,더욱 만족하였고, 향후에도 지속적으로 상호작용하고 싶다는 의도를 보였다.</p>\r\n\r\n<p>이들은 이러한 결과를 고객들은 판매원의 우수한 청취행동을 판매원이 자신들에게 성실한 관심을&nbsp;보이고 있다는 증거로 인식하기 때문에 청취행동을 잘 수행했다고 지각되는 판매원을&nbsp;더욱 신뢰하고, 해당 판매원과의 거래에 대해 더욱 높은 통제감과 충족감 등을 느끼고,&nbsp;해당 판매원과의 거래에 대해 더욱 만족하게 된다고 설명하고 있다.</p>\r\n\r\n<p>또한 Clopton etal.(2001)의 연구에서는 고객의 불평을 주의깊게 청취하려는 판매원과 상호작용한 고객들은 상대적으로 덜 공격적인 불평을 하고, 주변사람들에게 해당 판매원이나 점포를 추천할 가능성도 높고, 향후에도 그 점포를 이용하기를 원한다는 실증연구결과를 보여주고 있다.</p>\r\n\r\n<p>이러한 여러 연구결과들은 중개서비스과정에 있어서 중개사의 청취행동은 고객과의 상호작용이나 커뮤니케이션의 핵심적 요소로서 중개사에 대한 고객의 신뢰와 중개서비스에 대한 고객만족을 창출하는데 있어서 기초가 된다는 추론을 가능하게 한다.</p>\r\n', 1, 0, 2, 27, '0', '200%');
