  (1, '/* 타이포그래피  */\r\n\r\nh1,\r\nh2,\r\nh3,\r\nh4,\r\nh5,\r\nh6 {\r\n  font-weight: 300;\r\n}\r\n\r\nh1 {\r\n  font-size: 30px;\r\n}\r\n\r\nh2 {\r\n  font-size: 26px;\r\n}\r\n\r\nh3 {\r\n  font-size: 22px;\r\n}\r\n\r\nh4 {\r\n  font-size: 17px;\r\n}\r\n\r\nh5 {\r\n  font-size: 13px;\r\n}\r\n\r\nh6 {\r\n  font-size: 12px;\r\n}\r\n\r\n/* 홈 지도 크기, 하단 모바일도 설정해야 함  */\r\n#home_map{\r\n border:1px solid #cacaca;\r\n box-shadow: 0px 2px 2px rgba(0,0,0,0.1);\r\n  width:100%;\r\n height:500px;\r\n}\r\n\r\n/* 홈 슬라이드 */\r\n.wrap_slider {\r\n  color: white;\r\n  height: 450px;\r\n  text-shadow: 0 0 4px rgba(1,1,1,3);\r\n}\r\n\r\n/* 홈 검색 선택 글자  */\r\n.nav-search > li a {\r\n  font-family:"Malgun Gothic";\r\n  color:white;\r\n}\r\n\r\n.nav-search > li.active a{\r\n  font-weight:bold;\r\n  color:#FFC525;\r\n}\r\n\r\n/* 홈 검색 버튼 */\r\n.btn-search {background-color:#ffc525;}\r\n\r\n.btn-search:hover, .btn-search:focus, .btn-search:active, .btn-search.active {\r\n  color: #efefef;\r\n}\r\n\r\n/* 홈 테마 바로기가 */\r\n.theme .cell {\r\n  background-size: cover !important;\r\n    -ms-behavior: url(/assets/js/backgroundsize.min.htc); \r\n  border-radius:0px;  \r\n  font-size:16px;\r\n text-align:center;\r\n  margin-bottom:20px;\r\n height:310px;\r\n background-position: center center !important;\r\n  /*box-shadow: 0 0 10px 6px #000;*/\r\n}\r\n\r\n@media screen and (max-width: 800px) {\r\n #home_map {height:250px;}\r\n}\r\n', 'Y', '2015-06-28 02:50:18');
INSERT INTO `faq` (`id`, `title`, `content`, `sorting`, `date`) VALUES
  (1, '회원 가입은 어떻게 하나요?', '메뉴 상단 또는 메뉴 우측에 있는 회원 가입 메뉴를 클릭하신 후 내용을 입력하신 후 가입하시면 됩니다. 회원 가입을 하면 자동으로 로그인이 되며 차후에 방문하실 때 로그인을 하시면 됩니다. 회원 정보는 철저하게 관리되고 있으며 암호는 암호화 되어 저장되어 있기 때문에 관리자도 알 수 없습니다. 그러므로 비밀번호가 유출될 가능성은 없습니다. 비밀번호를 분실하셨을 경우에는 비밀번호 찾기를 하셔서 초기화된 비밀번호를 이메일을 통해서 받으신 후 로그인하셔서 다시 변경해서 사용해 주세요.', 1, '2015-07-11 09:01:38'),
  (2, '제휴하고 싶습니다.', '윈윈할 수 있는 다양한 제휴를 환영합니다. 전화 또는 이메일을 통해서 제휴하시고자 하는 업무나 사업에 대해서 설명해 주세요. 적극적으로 검토하여 서로에게 도움이 되었으면 합니다.', 2, '2015-07-11 09:11:00'),
  (3, '직거래와 중개거래의 차이는 무엇인가요?', '직거래는 매수자와 매도자가 중개자 없이 직접 거래하는 방식입니다. 중개거래는 공인중개사의 중개에 의해서 거래되는 방식입니다. 직거래는 중개 수수료가 발생을 하지 않지만 거래 상의 위험이 존재하여 주의가 필요합니다. 중개거래는 공인중개사의 중개하에 거래가 이뤄지기 때문에 위험요소가 크게 감소합니다.', 3, '2015-07-11 09:13:50');
