(10009, '2014-11-21 14:53:22', '2015-01-06 17:12:11', '방배동 쓰리룸 전세 2.5억 방배초, 서래초', '', 326, '0', 'full_rent', 'Y', 12, 35000, 0, 25000, 0, 0, 0, NULL, NULL, 2, '1', 3, 1, '도시가스,싱크대', '방배까페골목, 쓰리룸전세, 방배초, 서래초', '<p>조용한주택가에 있는 빌라 입니다~</p>\n\n<p>학군이 워낙좋아 아이있는 가정도 좋고, 버스정류장과 내방역과도 가까워서,</p>\n\n<p>직장인들도 좋습니다~</p>\n\n<p>깨끗해서 신혼부부들에도 너무 좋을거 같아요^^</p>\n\n<p>&nbsp;</p>\n\n<p>초등학교는 방배초, 서래초</p>\n\n<p>중,고등학교는 8학군 입니다~</p>\n\n<p>전세도 가능합니다~(25000만원)</p>\n\n<p>&nbsp;</p>\n\n<p>궁금하신점 있으시면 언제든 연락주세요!!</p>\n\n<p>친절히 상담해 드릴게요^^</p>\n', '777-16', 37.492681815713, 126.988477243794, 59.24, 65.32, NULL, NULL, NULL, '2015년2월27일 전후 입주협의', '1995년12월', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 32, 3, 240, '0', '방배까페골목, 쓰리룸전세, 방배초, 서래초', NULL, '', '', ''),
(10010, '2014-11-21 17:31:44', '2014-12-13 23:05:39', '서울대입구 반짝반짝 신축아파트~', '', 108, '1', 'sell', 'Y', 14, 23400, 0, 0, 0, 0, 0, NULL, NULL, 5, '3', 2, 1, '지하주차장, 차량통제시스템, CCTV', '서울대입구역의 신축아파트 입니다', '<p>서울대입구 도보 12분, 버스 3분거리에 위치한 아파트(도시형생활주택)을 소개 드립니다.</p>\n\n<p>&nbsp;</p>\n\n<p>지하에 아파트 입주민만을 위한 자동개폐식 주차장이 있고 1층에도 주차장이 있습니다.</p>\n\n<p>&nbsp;</p>\n\n<p>거실이 넓직하게 빠져있어 시원한 느낌을 주네요~</p>\n\n<p>&nbsp;</p>\n\n<p>방이 두개지만 방도 큼직하게 되어 있어 침대를 놓더라도 작아보이지 않을것&nbsp; 같습니다.</p>\n\n<p>&nbsp;</p>\n\n<p>화장실외에 세탁기를 둘수 있는&nbsp;주방옆 베란다 같은 공간이 따로 있어서 좋네요..</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', '15-4', 37.4875705086562, 126.956868320837, 0, 0, NULL, NULL, NULL, '즉시 입주가능', '2014-11', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 23, 3, 100, '0', '서울대입구역, 신축아파트', NULL, '', '', NULL),
(10012, '2014-11-22 07:39:55', '2014-12-05 18:11:26', '서울대입구 신축빌라 쓰리룸', '', 108, '1', 'full_rent', 'Y', 12, 0, 0, 16000, 0, 0, 0, NULL, NULL, 5, '3', 3, 1, '엘리베이터,주차장,도시가스,싱크대,가스레인지,신발장,인터폰,전자키', '서울대입구 도보10분, 신축쓰리룸, 전세1.6억, 즉시입주가능', '<p>즉시입주가능한 신축빌라 쓰리룸입니다.</p>\n\n<p>&nbsp;</p>\n\n<p>방은 좀 작은편이지만요..</p>\n\n<p>전세&nbsp;찾아보신 분은 아시겠지만,</p>\n\n<p>이 정도 가격에&nbsp; 신축 쓰리룸 전세 구하기는 하늘에 별따기예요...</p>\n\n<p>&nbsp;</p>\n\n<p>걸어서 서울대 입구까지 10분, 마을버스 가깝고 1층이 필로티구조라 주차 가능하답니다.</p>\n', '15-14', 37.4858584701371, 126.959813222229, 0, 0, NULL, NULL, NULL, '즉시입주가능', '2014년 11월', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 17, 3, 56, '0', '서울대입구 10분, 전세 1.6억', NULL, '', '', NULL),
(10014, '2014-11-23 04:56:00', '2015-02-25 06:10:01', '잠원동 신반포 16차, 한신아파트 2층', '', 338, '0', 'sell', 'N', 14, 52000, 0, 0, 0, 0, 0, NULL, NULL, 0, '11', 0, 0, '', '호텔급 특 올수리, 고수부지 옆, 17평형 아파트, 재건축', '<p>고수부지 바로옆에 있는 재건축 동의서 진행중인 아파트입니다.</p>\n\n<p>&nbsp;</p>\n\n<p>2015년 3월 입주가 가능하구요</p>\n\n<p>&nbsp;</p>\n\n<p>현재 계시는 분이 2013년 입주하시면서 완전 호텔급으로 특 올수리를 하셔서 집상태는 최고입니다.</p>\n\n<p>&nbsp;</p>\n\n<p>재건축이 진행되면 한강조망이 가능한 최고의 물건으로 거듭날거라 보이네요..</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', '55-12', 37.5169949628572, 127.00975472632, 52.77, 41.1, NULL, NULL, NULL, '2015년 3월', '1983년 1월', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 0, 0, 17, 3, 37, '0', '호텔급 특 올수리, 고수부지 옆, 재건축', NULL, '', '', NULL),
(10017, '2014-11-23 06:23:34', '2014-12-23 12:15:18', '넓고 깨끗한 원룸', '', 302, '0', 'monthly_rent', 'Y', 13, 0, 0, 0, 70, 1000, 0, NULL, NULL, 5, '2', 1, 1, '엘리베이터,주차장,도시가스,싱크대,냉장고,세탁기,가스레인지,에어컨,책상,옷장,신발장,인터폰,전자키', '엘리베이터, 주차장, 풀옵션, 전용7평, 홍대입구역, 연세대남문, ', '<p>-보증금 2000 월세60 으로 조정가능, 관리비 3만원별도<br />\n<br />\n-넓은 1층 필로티주차장이 있어 실제로는 2층이구요..</p>\n\n<p>&nbsp; 주차공간 충분하여 주차에 문제없습니다. 엘리베이터도 있구요...<br />\n<br />\n-도배와 입주청소까지 완료!</p>\n\n<p><br />\n<br />\n-한샘씽크대, 하우젠 드럼세탁기, 2구 가스쿡탑, 투도어냉장고, 2명이 사용해도 충분한 옷장과 우산 장화까지 모두 수납 가능한 커다란 신발장<br />\n<br />\n-실내에서 외부인 확인이 가능한 화상형 인터폰과 전자키.<br />\n<br />\n-화장실 변기도 새것으로 교체하고, 세면대샤워기까지 전부 새로 교체..<br />\n<br />\n-보일러실도 넓직하고,&nbsp;곰팡이 하나 없네요</p>\n\n<p><br />\n<br />\n-집앞이 트여 있어 채광과 통풍이 좋으며, 건물입구 바로 앞에 가로등이 있어 여자분들 늦은 저녁 귀가시간에도 안전합니다.</p>\n', '229-1', 37.5595357, 126.9301515, 23.04, 13.92, NULL, NULL, NULL, '2015년1월 24일', '2007년 11월', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 0, 0, 30, 3, 90, '0', '풀옵션, 주차가능, 엘리베이터, 홍대입구, 연세대, 이화여대, 홍익대, 원룸', NULL, '', '', NULL),
(10023, '2014-11-24 13:22:25', '2014-11-24 13:59:14', '사당역도보10분, 깨끗한원룸,조용한주택가', '', 104, '0', 'full_rent', 'N', 13, 0, 0, 4500, 0, 0, 0, NULL, NULL, 1, '5', 0, 0, '엘리베이터,주차장,도시가스,싱크대,냉장고,세탁기,가스레인지,에어컨,책상,책장,침대,옷장,신발장,인터폰,전자키,인터넷', '교통좋은사당역 조용한 원룸', '<p>관리비 5만원(인터넷,쿡tv포함)</p>\n\n<p>2,4호선사당역 도보10분</p>\n\n<p>버스정류장 도보 5분</p>\n\n<p>조용한주택가</p>\n\n<p>깨끗한 원룸</p>\n', '1071-8 ', 37.4733964, 126.9731281, 26.4, 0, NULL, NULL, NULL, '즉시', '', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 20, 3, 115, '0', '역세권원룸, 깨끗한원룸, 풀옵션원룸', NULL, '', '', NULL),
(10027, '2014-11-26 14:14:58', '2014-12-23 08:34:28', '사당동, 이수역, 깨끗하고 세련된 풀옵션 인테리어 신축 투룸, 역세권', '', 246, '1', 'monthly_rent', 'Y', 12, 0, 0, 0, 80, 5000, 0, NULL, NULL, 5, '2', 2, 1, '주차장,도시가스,싱크대,세탁기,인덕션,전자레인지,에어컨,옷장,신발장,인터폰,전자키', '신혼부부가 거주하기 매우 좋은 환경입니다.', '<p align="center" style="text-align: center;"><span style="font-size: 12pt;">신축 첫 입주하는 너무 깨끗하고 고급스러운 투룸입니다.</span>&nbsp;</p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="font-size: 12pt;"><span style="color: rgb(0, 117, 200);"><strong>외관은 노출콘크리트</strong></span>로 처리가 되어 있구요..</span></span><br />\n<br />\n<span style="font-size: 12pt;">주인분께서 인테리어에 신경을 많이쓰신 집이네요..</span><br />\n<br />\n<br />\n<br />\n<span style="font-size: 12pt;"><span style="color: rgb(255, 0, 0);"><strong>세탁기등 모두 빌트인</strong></span>으로 설치가 되어 있는데다 </span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(255, 0, 0);"><strong>천정형 시스템에어컨이 기본 설치</strong></span>되어 있습니다.</span></p>\n\n<p align="center" style="text-align: center;"><br />\n<span style="font-size: 12pt;">﻿방이 약간 좁아보일수가 있는데 <span style="color: rgb(255, 0, 0);"><strong>한쪽 벽으로&nbsp;쭈~~욱 붙박이장</strong></span>이 자리잡고 있어서 </span>&nbsp;</p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(0, 158, 37);"><strong>별도로 가구를 들이실 필요가 없는 방</strong></span>이고, 그래서 오히려 수납효율이 좋은&nbsp;</span>&nbsp;<span style="font-size: 12pt;">방입니다. </span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;">﻿</span><br />\n<br />\n<span style="font-size: 12pt;"><span style="color: rgb(0, 117, 200);"><strong>방 바깥쪽은 커다란 유리로 마감</strong></span>되어 있어 갑갑하지 않고 시원한 느낌인데다</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;">&nbsp;유리창마다 모두 <strong>롤스크린이 기본 설치</strong>되어 있네요.</span><br />\n<br />\n<span style="font-size: 12pt;">샤시부터 손잡이, 스위치, 등 하나하나에 세심하게 신경을 써서 지어진 집으로</span><br />\n<br />\n<span style="font-size: 12pt;">여느집과는 차별화가 되어 있습니다.</span><br />\n<br />\n<br />\n&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(255, 0, 0);"><strong>이수역이 도보로 5분이내</strong></span>에 이용가능하며,<br />\n<br />\n<span style="color: rgb(255, 0, 0);"><strong>버스정류장은 도보로 3분거리</strong></span>에 위치하고 있어 교통이 매우 편리한 곳에 위치하고 있습니다.</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;">동작대로변에서 40여m 떨어져있어 조용하면서도 안전하게 다니실수 있으며<br />\n<br />\n<span style="color: rgb(0, 117, 200);"><strong>건물내 cctv가 설치</strong></span>되어 있고,<span style="color: rgb(0, 117, 200);"><strong>주차1대 가능</strong></span>합니다.</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p>&nbsp;</p>\n', '1009-30', 37.4810456029578, 126.979603847082, 30.9, 40.28, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 17, 3, 161, '0', '신혼부부빌라, 이수역투룸, 투룸, 역세권투룸, 사당동투룸, 사당동빌라, 사당동, 이수역', NULL, '', '', NULL),
