(10043, '2014-12-04 11:49:53', '2014-12-12 17:14:29', '초 역세권, 이수역 10초, 큰대로변상가2층', '', 326, '0', 'monthly_rent', 'Y', 16, 0, 0, 0, 700, 10000, 0, NULL, NULL, 10, '2', 0, 0, '엘리베이터,CCTV,현관보안,화재경보기,주차장', '너무 깔끔한 건물이라 병원등 모든업종 너무 좋아요~~', '<p>초역세권에 위치하고있는 깨끗한 건물입니다^^</p>\n\n<p>이수역대로변에 있어 역에서 바로 보이는 건물입니다~</p>\n\n<p>이수역이라 역세권이며, 아파트단지도 많이 밀집되 있는 곳이라</p>\n\n<p>병원등의 상가로 아주 좋아요^^</p>\n\n<p>궁금하신점 연락 주세요^^</p>\n', '3160', 37.4867208, 126.982669, 138, 198, NULL, NULL, NULL, '즉시가능', '2005.11', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 0, 3, 60, '0', '대로변병원OK, 초역세권, 아파트밀집지역', NULL, '', '', NULL),
