"color: rgb(255, 0, 0); font-size: 18pt;">주차장도 A</span>&nbsp;이라고 자부할수 있습니다.</span></p>\n\n<p><br />\n<span style="font-size: 14pt;">&nbsp;(주차장은 왜 A++이 아니냐면 층수별로 주차가 1대씩만 가능하기 때문입니다..ㅠ </span></p>\n\n<p><span style="font-size: 14pt;">&nbsp;&nbsp; 이점도 중요한 문제이기 때문에 이렇게 자세히 적어봅니다.)</span></p>\n\n<p><span style="font-size: 14pt;">하지만 바로 앞 </span><span style="color: rgb(255, 0, 0); font-size: 18pt;"><u>공용주차장</u></span><span style="font-size: 14pt;">이 있기때문에 걱정하지 않으셔도 됩니다!!</span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">인테리어는 마치&nbsp;갤러리 같은 느낌이 드네요~!!</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">그리고 <span style="color: rgb(255, 0, 0); font-size: 18pt;"><u><strong>무엇보다 가장 중요한 보증금과 월세!!!!!!!!</strong></u></span></span></p>\n\n<p><span style="color: rgb(255, 0, 0); font-size: 14pt;"><strong><u><span style="font-size: 18pt;">보증금은 3000 </span></u><span style="color: rgb(0, 0, 0); font-size: 18pt;">/</span><u><span style="font-size: 18pt;"> 월&nbsp;140 </span></u><span style="color: rgb(0, 0, 0); font-size: 18pt;">/</span><u><span style="font-size: 18pt;"> 관리비 55만입니다.!!</span></u></strong></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">깔끔한 신축 빌딩 사무실/상가 알아보시는 분들에게 강력 추천해 드리고 싶습니다!!</span><span style="font-size: 14pt;">&nbsp;</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">궁금하신 점 있으신다면 주저하지마시고 연락주세요!!!!<span style="font-size: 18pt;"> </span></span><span style="color: rgb(255, 0, 0); font-size: 18pt;">★★</span><span style="color: rgb(255, 0, 0); font-size: 18pt;">당신을 기다립니다</span><span style="color: rgb(255, 0, 0); font-size: 18pt;">&hearts;&hearts;</span></p>\n', '3005', 37.4864352307901, 126.981021387794, 65.45, 114.51, NULL, NULL, NULL, '바로입주가능', '2014년 4월', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 0, 0, 7, 3, 92, '0', '이수,방배,방배사무실,이수역사무실,이수상가,이수역상가,역세권상가,상가,빌딩,이수인근상가,방배인근상가,깨끗한사무실,저렴한사무실,사무실', NULL, '', '', NULL),
