14년4월에 준공한 최신 </span><span style="color: rgb(0, 117, 200);">디자인의 건물</span></strong> 이구요&nbsp;현재 완전 새건물입니다</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;">출입구부터&nbsp;승강기 계단 화장실 건물내 모든 시설이 깔끔하게 </span><span style="font-size: 12pt;">인테리어 되어있습니다~!</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><strong><span style="color: rgb(0, 117, 200);">3면에 큰창이<span style="color: rgb(0, 117, 200);"> </span></span><span style="color: rgb(0, 117, 200);">있어</span></strong><span style="color: rgb(0, 117, 200);"><strong>&nbsp;햇빛 잘 들어 아주 밝고 넓은느낌 입니다</strong></span></span></p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(0, 117, 200);">​</span></span></p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(0, 0, 0);">평소 갑갑했던 사무실과는 완전 다른 느낌이겠죠?^^&nbsp;</span></span></p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(0, 117, 200);">​</span></span></p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;"><span style="color: rgb(0, 117, 200);">​</span></span><span style="font-size: 12pt;">전층에는 시스템 냉난방 시설이 잘 되어있구요~!</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;">1,2 층에는 카페, 4층 한의원 &nbsp;5~10층까지 일반 사무실 입점 되어있습니다</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="font-size: 12pt;">주차는 각층 1대씩 가능하며 최신 <span style="color: rgb(0, 117, 200);"><strong>기계식 주차장 시설 완비</strong> </span><span style="color: rgb(0, 0, 0);">되어있습니다</span></span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="color: rgb(0, 0, 0); font-size: 12pt;">근처 공용 주차장이 있어 저렴한 가격으로 이용 가능 하십니다:)</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="color: rgb(0, 0, 0); font-size: 12pt;">문의사항 있으시면 망설이지 마시고 언제든지 연락 주시면 친절히</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;"><span style="color: rgb(0, 0, 0); font-size: 12pt;">안내해드릴 수 있도록 하겠습니다^^</span></p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n\n<p align="center" style="text-align: center;">&nbsp;</p>\n', '3005', 37.4853049534433, 126.981304414542, 93.69, 126.25, NULL, NULL, NULL, '바로입주가능', '2014년4월', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 0, 0, 7, 3, 119, '0', '방배동사무실,방배동 병원, 이수역병원, 이수역사무실, 넓은평수사무실, 이쁜인테리어, 깔끔한인테리어, 신축건물', NULL, '', '', NULL),
