(10087, '2014-12-24 16:12:21', '2015-01-16 13:08:22', '방배,내방역 인근 사무실', '', 326, '0', 'monthly_rent', 'Y', 16, 0, 0, 0, 70, 1000, 0, NULL, NULL, 5, '3', 1, 0, '엘리베이터,자체경비원,주차장', '저렴한사무실,내방역인근', '<p><span style="font-size: 14pt;">방배 인근 저렴한 사무실 정보입니다.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="color: rgb(255, 0, 0); font-size: 18pt;"><strong><u>보증금 1000 / 월 70 </u></strong></span><span style="font-size: 14pt;">입니다!!!!! </span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">엄청저렴하게 나온 사무실이기 때문에</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">현재 사무실 알아보고 계시는 분들이라면 놀랄만한 정보가 아닌가 생각이 됩니다.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">주차는 당연히 가능하고 대로변 바로 옆이기 때문에 위치또한 나쁘지 않은것 같네요~!!!</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;"><span style="color: rgb(255, 0, 0);"><strong>면적은 26.1~26.4</strong></span> 정도 입니다.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">작은 사무실 알아보고 계시는 분들 서둘러서 전화주세요~^^</span></p>\n', '793-21', 37.4931930559859, 126.988840188402, 26.1, 26.1, NULL, NULL, NULL, '바로입주가능', '', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 14, 3, 49, '0', '내방역사무실,내방사무실,저렴한사무실,사무실,사무실임대,사무실월세,방배사무실,방배인근사무실', NULL, '', '', ''),
(10095, '2014-12-26 11:25:15', NULL, '사당,이수 인근 무권리 1층 상가 사무실', '', 246, '0', 'monthly_rent', 'Y', 16, 0, 0, 0, 120, 3300, 0, NULL, NULL, 3, '1', 1, 0, '', '1층,10평,시장위치', '<p><span style="font-size: 14pt;">벌써 2014년&nbsp;12월의 마지막 주말이네요.</span></p>\n\n<p><span style="font-size: 14pt;">12월 마무리를 하면서 돌이켜보니&nbsp;한해가 너무 빨리 지나간것 같아서</span></p>\n\n<p><span style="font-size: 14pt;">뭔가 허전하고 아쉽고 그러네요.​</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">​</span><span style="font-size: 14pt;">오늘 소개해드릴 매물은 사당 시장속에 위치한 사무실,점포로 위치 좋고,</span></p>\n\n<p><span style="font-size: 14pt;">가시성 좋고, 접근성 까지 좋은&nbsp;아주 뛰어난 매장으로&nbsp;</span><span style="font-size: 14pt;">무권리 매물을</span></p>\n\n<p><span style="font-size: 14pt;">소개합니다.</span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 14pt;">요즘 같은 시기에 도로변에 권리금 없이 들어가기 어려운게 현실인데</span></p>\n\n<p><span style="font-size: 14pt;">거기에 위치까지 좋아 대박날 자리가 아닌가 싶네요.</span></p>\n\n<p><span style="font-size: 14pt;">지금이 딱 좋은 기회라는 생각까지 듭니다.</span></p>\n\n<p><span style="font-size: 14pt;">​</span></p>\n\n<p><span style="font-size: 14pt;">창업을 준비하시는 분들은 점포선정 문제로 고심이 많으실텐데, 찾으시는 점포가 이런 매물이 아닌가&nbsp;하는 생각도 들구요~</span></p>\n\n<p><span style="font-size: 14pt;">​꼭 이런 매물이 아니더라고 좋은 위치 및 착한 가격의 매물을 가지고</span></p>\n\n<p><span style="font-size: 14pt;">있어 창업을 준비하시는 분들에게 도움을 드릴수 있을꺼 같아요.</span></p>\n\n<p><span style="font-size: 14pt;">​</span></p>\n\n<p><span style="font-size: 14pt;">기회는 왔을때 잡아야 대박날수&nbsp;있습니다. 그 기회 꼭 잡으시길 바라며...많은 문의 부탁 드리겠습니다. </span></p>\n\n<p>&nbsp;</p>\n', '1033-34', 37.4795837950091, 126.979328180452, 33.06, 33.06, NULL, NULL, NULL, '바로 입주가능', '', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 0, 0, 14, 3, 41, '0', '사당사무실,사당점포,사당역점포,사당역사무실,1층사무실,1층점포', NULL, '', '', NULL),
